import React from 'react'
import style from './index.module.scss'
import Empty from '../empty'
import List from '../list'

export default function index() {
  const order_list = [
    {
      order_id: '999',
      type: 'pickup',
      status: 'done',
      time: '88',
      add_from: 'aaa',
      add_to: 'airport',
      price: 34
    },
    {
      order_id: 'zzz',
      type: 'dropoff',
      status: 'done',
      time: 'sss',
      add_from: 'zzz',
      add_to: 'airportaaa',
      price: 22
    }
  ]
  return (
    <div className={style.item_container}>
      {order_list.length ? <List order_list={order_list} /> : <Empty />}
    </div>
  )
}
